import React, { useState } from 'react';
import ReactDOM from 'react-dom';

const GameUI = () => {
	return ( <div className='Game'>
		<div className="game-heading text-center mt-4">
			<div className=' mt-4'><img className='mt-4' src="images/logo.svg" alt="logo"/></div>
			<div className='mt-4 .cardbox_card_heading'><h1>5000</h1></div>
		</div>
	</div>
	)
}

export {GameUI} ;
